import React, { useState } from "react";
import { Routes, Route, Link, useNavigate } from "react-router-dom";
import Homepage from "./pages/homepage/homepage";
import Users from "./pages/Users/users";
import Community from "./pages/Community/community";
import Map from "./pages/Map/map";
import Emergency from "./pages/Emergency/emergency";
import Overview from "./pages/Overview/overview";
import "./App.css";

const App = () => {
  const [user, setLoginUser] = useState({});

  return (
    <div className="App">
      <div className="sidebar">
        <ul>
          <li>
            <Link to="/homepage">Homepage</Link>
          </li>
          <li>
            <Link to="/users">Users</Link>
          </li>
          <li>
            <Link to="/community">Community</Link>
          </li>
          <li>
            <Link to="/map">Map</Link>
          </li>
          <li>
            <Link to="/emergency">Emergency</Link>
          </li>
          <li>
            <Link to="/overview">Overview</Link>
          </li>
        </ul>
      </div>
      <div className="content">
        <Routes>
          <Route
            path="/"
            element={
              <Homepage
                setLoginUser={setLoginUser}
                isLoggedIn={user && user._id}
              />
            }
          />
          <Route
            path="/users"
            element={<Users isLoggedIn={user && user._id} />}
          />
          <Route
            path="/community"
            element={<Community isLoggedIn={user && user._id} />}
          />
          <Route path="/map" element={<Map isLoggedIn={user && user._id} />} />
          <Route
            path="/emergency"
            element={<Emergency isLoggedIn={user && user._id} />}
          />
          <Route
            path="/overview"
            element={<Overview isLoggedIn={user && user._id} />}
          />
        </Routes>
      </div>
    </div>
  );
};

export default App;
